import React, { Component } from 'react';

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: 'James'
    }
  }

  render() {
    const name = this.state.name;

    return (
      <div>
        <h1>{name}.</h1>
        <input
          type="text"
          value={name}
          onChange={ e  => {
            this.setState({
              name: e.target.value
            })
          }}
        />
      </div>
    );
  }
}
